import React from "react";

import city from "../../data/city.json";

const City = () => {
  return city.map((item) => (
    <div className="container" key={item.name}>
      <div className="col-md-3">
        {item.image}
        {item.name}
        {item.subText}
      </div>
    </div>
  ));
};
export default City;
